function b64toBlob(a) { 
    var b; 
    b = a.split(",")[0].indexOf("base64") >= 0 ? atob(a.split(",")[1]) : unescape(a.split(",")[1]); 
    for (var c = a.split(",")[0].split(":")[1].split(";")[0], d = new Uint8Array(b.length), e = 0; e < b.length; e++) d[e] = b.charCodeAt(e); 
    return new Blob([d], { 
        type: c 
    }) 
} 
 
function getMimeType(a) { 
    var b = a.substr(a.length - 4).toLowerCase(); 
    switch (b) { 
        case ".jpg": 
            return "image/jpeg"; 
        case "jpeg": 
            return "image/jpeg"; 
        case ".gif": 
            return "image/gif"; 
        case ".png": 
            return "image/png"; 
        case "docx": 
            return "application/vnd.openxmlformats-officedocument.wordprocessingml.document"; 
        case ".pdf": 
            return "application/pdf" 
    } 
    return "" 
} 
 
